import textColor from "../../../styles/Color";
import ProjectBox from "./ProjectBox";
import ShortProjectDescription from "../../../Text Sources/ShortProjectDescription";

import MLreport from "../../../Images/Snapshot/MLreport.png";

const styles = {
    container: {
        textAlign: 'center',
        marginBottom: '100px',
        width: '500px',
        padding: '30px',
        margin: '50px',
    },
    titaleText: {
        color: textColor.MainBlue,
        fontSize: '25px',
        fontWeight: 'bold',
    },
    lineBreakContainer: {
        display: 'flex',
        justifyContent: 'center',
    },
    lineBreak: {
        width: '600px',
    },
    descriptionText: {
        color: 'white',
        marginTop: '10px',
        lineHeight: '30px',
        fontSize: '18px',
    },
    toolsContainer: {
    }
}

function ProjectContainer(props){
    return (
        <div className={styles.container}>
            <ProjectBox title="eICU mortality prediction"
            image={MLreport} 
            description={ShortProjectDescription.MLICU}
            />
        </div>
    );
}

export default ProjectContainer;
